import React from "react";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";

export default class TopComponent extends React.Component {
    constructor(props){
        this.state = {
            gamestate: null
        }
    }

    render(){
        return <div>
              <Router>
            <Switch>
          <Route path="/create">
            <Create />
          </Route>
          <Route path="/join">
            <Join />
          </Route>
          <Route path="/lobby">
            <Lobby />
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
  </Router>
        </div>
    }
}
